CREATE DATABASE TheMovieDatabase;

USE TheMovieDatabase
GO

CREATE TABLE [dbo].[CastAndCrew] (
    [PersonID]  INT          IDENTITY (1, 1) NOT NULL,
    [FirstName] VARCHAR (30) NOT NULL,
    [LastName]  VARCHAR (30) NOT NULL,
    CONSTRAINT [PK_Cast_and_Crew] PRIMARY KEY CLUSTERED ([PersonID] ASC)
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [CastAndCrew_No_Duplicates]
    ON [dbo].[CastAndCrew]([FirstName] ASC, [LastName] ASC);


CREATE TABLE [dbo].[Genres] (
    [GenreID] INT          IDENTITY (1, 1) NOT NULL,
    [Name]    VARCHAR (20) NOT NULL,
    CONSTRAINT [PK_Genres] PRIMARY KEY CLUSTERED ([GenreID] ASC)
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [Genres_No_Duplicates]
    ON [dbo].[Genres]([Name] ASC);

CREATE TABLE [dbo].[Movies] (
    [MovieID]     INT           IDENTITY (1, 1) NOT NULL,
    [Title]       VARCHAR (100) NOT NULL,
    [ReleaseDate] DATE          NOT NULL,
    [Runtime]     TIME (0)      NULL,
    [Overview]    TEXT          NOT NULL,
    [Cover]       IMAGE         NULL,
    CONSTRAINT [PK_Movies] PRIMARY KEY CLUSTERED ([MovieID] ASC)
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [Movies_No_Duplicates]
    ON [dbo].[Movies]([Title] ASC, [ReleaseDate] ASC);

CREATE TABLE [dbo].[Users] (
    [UserID]    INT           IDENTITY (1, 1) NOT NULL,
    [Email]     VARCHAR (40)  NOT NULL,
    [Password]  VARCHAR (100) NOT NULL,
    [FirstName] VARCHAR (30)  NOT NULL,
    [UserType]  VARCHAR (10)  NOT NULL,
    CONSTRAINT [PK_Users] PRIMARY KEY CLUSTERED ([UserID] ASC)
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [Users_Unique_Email]
    ON [dbo].[Users]([Email] ASC);

CREATE TABLE [dbo].[MovieDirectors] (
    [MovieDirectorsID] INT IDENTITY (1, 1) NOT NULL,
    [MovieID]          INT NOT NULL,
    [PersonID]         INT NOT NULL,
    CONSTRAINT [PK_MovieDirectors] PRIMARY KEY CLUSTERED ([MovieDirectorsID] ASC),
    CONSTRAINT [FK_MovieDirectors_CastAndCrew] FOREIGN KEY ([PersonID]) REFERENCES [dbo].[CastAndCrew] ([PersonID]),
    CONSTRAINT [FK_MovieDirectors_Movies] FOREIGN KEY ([MovieID]) REFERENCES [dbo].[Movies] ([MovieID])
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [MovieDirectors_No_Duplicates]
    ON [dbo].[MovieDirectors]([MovieID] ASC, [PersonID] ASC);

CREATE TABLE [dbo].[MovieGenres] (
    [MovieGenresID] INT IDENTITY (1, 1) NOT NULL,
    [GenreID]       INT NOT NULL,
    [MovieID]       INT NOT NULL,
    CONSTRAINT [PK_MovieGenres] PRIMARY KEY CLUSTERED ([MovieGenresID] ASC),
    CONSTRAINT [FK_MovieGenres_Genres] FOREIGN KEY ([GenreID]) REFERENCES [dbo].[Genres] ([GenreID]),
    CONSTRAINT [FK_MovieGenres_Movies] FOREIGN KEY ([MovieID]) REFERENCES [dbo].[Movies] ([MovieID])
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [MovieGenres_No_Duplicates]
    ON [dbo].[MovieGenres]([GenreID] ASC, [MovieID] ASC);

CREATE TABLE [dbo].[MovieWriters] (
    [MovieWritersID] INT IDENTITY (1, 1) NOT NULL,
    [MovieID]        INT NOT NULL,
    [PersonID]       INT NOT NULL,
    CONSTRAINT [PK_MovieWriters] PRIMARY KEY CLUSTERED ([MovieWritersID] ASC),
    CONSTRAINT [FK_MovieWriters_CastAndCrew] FOREIGN KEY ([PersonID]) REFERENCES [dbo].[CastAndCrew] ([PersonID]),
    CONSTRAINT [FK_MovieWriters_Movies] FOREIGN KEY ([MovieID]) REFERENCES [dbo].[Movies] ([MovieID])
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [MovieWriters_No_Duplicates]
    ON [dbo].[MovieWriters]([MovieID] ASC, [PersonID] ASC);

CREATE TABLE [dbo].[Ratings] (
    [MovieRatingsID] INT IDENTITY (1, 1) NOT NULL,
    [MovieID]        INT NOT NULL,
    [UserID]         INT NOT NULL,
    [Rate]           INT CONSTRAINT [DF__Ratings__Rate__01142BA1] DEFAULT (NULL) NOT NULL,
    CONSTRAINT [PK_Ratings] PRIMARY KEY CLUSTERED ([MovieRatingsID] ASC),
    CONSTRAINT [FK_Ratings_Users] FOREIGN KEY ([UserID]) REFERENCES [dbo].[Users] ([UserID]),
    CONSTRAINT [FK_Ratings_Movies] FOREIGN KEY ([MovieID]) REFERENCES [dbo].[Movies] ([MovieID]),
    CONSTRAINT [CK_Ratings] CHECK ([Rate]>=(0) AND [Rate]<=(10))
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [Ratings_No_Duplicates]
    ON [dbo].[Ratings]([MovieID] ASC, [UserID] ASC);

CREATE TABLE [dbo].[WantToSee] (
    [WantToSeeID] INT IDENTITY (1, 1) NOT NULL,
    [UserID]      INT NOT NULL,
    [MovieID]     INT NOT NULL,
    CONSTRAINT [PK_WantToSee] PRIMARY KEY CLUSTERED ([WantToSeeID] ASC),
    CONSTRAINT [FK_WantToSee_Users] FOREIGN KEY ([UserID]) REFERENCES [dbo].[Users] ([UserID]),
    CONSTRAINT [FK_WantToSee_Movies] FOREIGN KEY ([MovieID]) REFERENCES [dbo].[Movies] ([MovieID])
);

GO
CREATE UNIQUE NONCLUSTERED INDEX [WantToSee_No_Duplicates]
    ON [dbo].[WantToSee]([MovieID] ASC, [UserID] ASC);

GO
CREATE VIEW [dbo].[Top10Movies] AS
SELECT TOP 10 Movies.Title, ROUND(AVG(CAST(Ratings.Rate AS FLOAT)), 2) as Average
FROM Movies
INNER JOIN Ratings
ON Movies.MovieID = Ratings.MovieID
GROUP BY Title
ORDER BY Average DESC;
GO

CREATE FUNCTION [dbo].[funMovieRate] (@id INT)
RETURNS FLOAT
AS
BEGIN
	IF EXISTS (SELECT Rate FROM Ratings WHERE MovieID = @id AND Rate > 0)
		RETURN (SELECT ROUND(AVG(CAST(Rate AS FLOAT)), 2) FROM Ratings WHERE MovieID = @id AND Rate > 0)
	RETURN CAST(0 AS FLOAT)
END
GO

CREATE PROCEDURE [dbo].[uspMovieByGenre]
	@genre varchar(20)
AS
BEGIN
	SELECT Movies.MovieID, Movies.Title
	FROM Movies
	INNER JOIN MovieGenres
	ON Movies.MovieID = MovieGenres.MovieID
	INNER JOIN Genres
	ON MovieGenres.GenreID = Genres.GenreID
	WHERE Genres.Name LIKE @genre;
END
GO

CREATE TRIGGER [dbo].[trgPassword]
ON Users
AFTER INSERT, UPDATE
AS
DECLARE
	@id int,
	@pass varchar(100)
BEGIN
	SELECT @id = UserID FROM inserted
	SELECT @pass = Password FROM inserted
	UPDATE Users SET Password = HASHBYTES('SHA2_512', @pass) WHERE UserID = @id
END
GO


